n            <!-- /ko -->\r\n        </td>\r\n    </tr>\r\n    <!-- ko foreach: getDetails() -->\r\n        <!-- ko foreach: rates -->\r\n        <tr class=\"totals-tax-details\">\r\n            <!-- ko if: percent -->\r\n                <th class=\"mark\" scope=\"row\" data-bind=\"text: title + ' (' + percent + '%)'\"></th>\r\n            <!-- /ko -->\r\n            <!-- ko if: !percent -->\r\n                <th class=\"mark\" scope=\"row\" data-bind=\"text: title\"></th>\r\n            <!-- /ko -->\r\n            <td class=\"amount\">\r\n                <!-- ko if: $parents[1].isCalculated() -->\r\n                <span class=\"price\"\r\n                      data-bind=\"text: $parents[1].getTaxAmount($parents[0], percent), attr: {'data-th': title, 'rowspan': $parents[0].rates.length }\"></span>\r\n                <!-- /ko -->\r\n                <!-- ko ifnot: $parents[1].isCalculated() -->\r\n                <span class=\"not-calculated\"\r\n                      data-bind=\"text: $parents[1].getTaxAmount($parents[0], percent), attr: {'data-th': title, 'rowspan': $parents[0].rates.length }\"></span>\r\n                <!-- /ko -->\r\n            </td>\r\n        </tr>\r\n        <!-- /ko -->\r\n    <!-- /ko -->\r\n<!-- /ko -->\r\n","Magento_Tax/template/checkout/summary/item/details/subtotal.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"subtotal\">\r\n    <!-- ko if: isPriceInclTaxDisplayed() && !getRegion('row_incl_tax') -->\r\n    <span class=\"price-including-tax\"\r\n          data-bind =\"text: getValueInclTax($parents[1]), attr:{'data-label': $t('Incl. Tax')}\">\r\n    </span>\r\n    <!-- /ko -->\r\n\r\n    <!-- ko if: isPriceInclTaxDisplayed() && getRegion('row_incl_tax') -->\r\n    <span class=\"price-including-tax\" data-bind =\"attr:{'data-label': $t('Incl. Tax')}\">\r\n            <!-- ko foreach: getRegion('row_incl_tax') -->\r\n                <!-- ko template: getTemplate() --><!-- /ko -->\r\n            <!-- /ko -->\r\n    </span>\r\n    <!-- /ko -->\r\n\r\n    <!-- ko if: isPriceExclTaxDisplayed() && !getRegion('row_excl_tax') -->\r\n    <span class=\"price-excluding-tax\"\r\n          data-bind =\"text: getValueExclTax($parents[1]), attr:{'data-label': $t('Excl. Tax')}\">\r\n    </span>\r\n    <!-- /ko -->\r\n    <!-- ko if: isPriceExclTaxDisplayed() && getRegion('row_excl_tax') -->\r\n    <span class=\"price-excluding-tax\" data-bind =\"attr:{'data-label': $t('Excl. Tax')}\">\r\n            <!-- ko foreach: getRegion('row_excl_tax') -->\r\n                <!-- ko template: getTemplate() --><!-- /ko -->\r\n            <!-- /ko -->\r\n    </span>\r\n    <!-- /ko -->\r\n</div>\r\n","Magento_Tax/template/price/adjustment.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<if args=\"displayBothPrices()\">\r\n    <span class=\"price-wrapper price-excluding-tax\"\r\n          attr=\"'data-label': $t('Excl. Tax')\"\r\n          data-price-amount=\"\"\r\n          data-price-type=\"basePrice\"\r\n          html=\"getTax($row())\">\r\n    </span>\r\n</if>\r\n","Magento_Tax/template/price/bundle/adjustment.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<if args=\"displayPriceIncludeTax()\">\r\n    <span class=\"price-wrapper price-excluding-tax\"\r\n          attr=\"'data-label': $t('Incl. Tax')\"\r\n          data-price-amount=\"\"\r\n          data-price-type=\"basePrice\"\r\n          html=\"getTaxUnsanitizedHtml($row())\"></span>\r\n</if>\r\n\r\n<if args=\"displayPriceExclTax()\">\r\n    <span class=\"price-wrapper price-excluding-tax\"\r\n          attr=\"'data-label': $t('Excl. Tax')\"\r\n          data-price-amount=\"\"\r\n          data-price-type=\"basePrice\"\r\n          html=\"getTaxUnsanitizedHtml($row())\"></span>\r\n</if>\r\n